import * as t from "react";
import e from "../lib/SSRBase.es.js";
import r from "../defs/Stamp.es.js";
const o = t.forwardRef((a, m) => /* @__PURE__ */ t.createElement(e, { ref: m, ...a, weights: r }));
o.displayName = "StampIcon";
const c = o;
export {
  c as Stamp,
  o as StampIcon
};
